void PrintNum( int Num ) {
	char buff[8] , *pBuff = buff+7 ; *pBuff = 0;	
	while (1) {			
	  int Mod = Num%10;
		*(--pBuff) = '0'+Mod;
		Num /= 10;
		if (!Num) { break; }
	}	
	PrintStr( pBuff );	
}

void PrintNum2( int iNum ) {
	static int Digs[] = {1,10,100,1000,10000}, i, n;	
	for( i=0 ; iNum >= Digs[i] ; i++ ) { if (i==4) {i=5;break;} ; }	
	for( i=--i ; i >= 0 ; i-- ) {
		int iAdd = Digs[i], iChk = iAdd;
		for( n=0 ; iChk < iNum ; iChk += iAdd , n++ ) {};
		pScreen[g_curpos++]='0'+n;
		if (!(iNum -= (iChk-iAdd))) {break;}
	}	
}

alias my_dcx_callback {
  if ($1 == awaypager) {
    if ($numtok($4-,32) > 2) {
      var %dname $1,%n $xdid(%dname,1,$4-).text,%t $xdid(%dname,1,$4-).tooltip
      set %away.curpage $regsubex(%t,/^Page:\t#(\d+).*/s,\1)
    }
    if ($2 == sclick) {
      if ($3 == 1) {
        if ($numtok($4-,32) > 2) {
          xdid -d %dname 1 $4-
          xdid -a %dname 1 $gettok($1-,4--2,32) $calc($gettok($1-,-1,32) - 1) $chr(9) + 0 0 0 0 0 0 0 %n $chr(9) $regsubex(%t,Unread$,Read)
          xdid -c %dname 1 $4-
          var %timeformat.short = HH:nn:ss,%dateformat.long = dddd $+ $chr(44) mmmm ddoo yyyy
          tokenize 32 $read(scripts\txt\awpages.txt,n,%away.curpage)
          did -ra %dname 8 $3
          did -ra %dname 10 $asctime($2,%dateformat.long)
          did -ra %dname 13 $asctime($2,%timeformat.short)
          did -ra %dname 15 $4-
          did -c %dname 8,10,13,15 1
          if (!$1) { write -l $+ %away.curpage scripts\txt\awpages.txt $puttok($1-,1,1,32) }
          did -e %dname 21
        }
        else {
          xdid -u %dname 1
          unset %away.curpage
          did -b %dname 21
          did -ra %dname 8 Select a page!
          did -ra %dname 10,13,15 n/a        
        }
      }
    }
    elseif ($2 == rclick) {
      if ($3 == 1) {
        popdll.new
        popdll.add 1	 $+ $iif(!%n,+g,+) 1 0 &Delete aw.rempages
        popdll.add 2	+ 2 0 -
        popdll.add 3	+ 3 0 &Refresh pages aw.loadpages
        popdll.add 4	 $+ $iif(!$did(awaypager,22).enabled,+g,+) 4 0 &Clear pages aw.clearpages
        popdll.disp
      }
    }
  }
}

