alias aw.loadpages {
  unset %away.curpage
  did -b awaypager 21
  var %d,%t,%a,%l = 1,%timeformat = yyyy-mm-dd $+ $chr(44) HH:nn:ss,%dateformat = yyyy-mm-dd,%z
  xdid -r awaypager 1
  xdid -a awaypager 1 1 $chr(9) +eb 0 0 0 0 0 0 0 Pages
  if ($isfile(scripts\txt\awpages.txt)) {
    .fopen pages scripts\txt\awpages.txt
    while (!$feof) {
      tokenize 32 $fread(pages)
      if ($regex($1-,/^0|1 \d+ .+ .+$/)) {
        %t = $asctime($2,%dateformat)
        if (%d != %t) {
          %z = 1
          xdid -a awaypager 1 -1 $chr(9) +e 0 0 0 0 0 0 0 %t
        }
        var %d = %t
        xdid -a awaypager 1 -1 -1 $chr(9) $iif($1,+,+b) 0 0 0 0 0 0 0 $gettok($3,1,33) $chr(9) $+(Page:,$chr(9),$chr(35),%l,$crlf,From:,$chr(9),$3,$crlf,Rcvd:,$chr(9),$asctime($2,%timeformat),$crlf,Status:,$chr(9),$iif($1,Read,Unread))
      }
      inc %l
    }
    .fclose pages
  }
  if (!%z) {
    did -b awaypager 22
    xdid -a awaypager 1 1 $chr(9) + 0 0 0 0 0 0 0 No pages received.
  }
  did -ra awaypager 8 Select a page!
  did -ra awaypager 10,13,15 n/a
}

// https://www.spiegel.de/karriere/ein-kreis-und-vier-tangenten-raetsel-der-woche-a-169b52ab-4cce-401a-98f6-57b3a7673f5a

// https://pastebin.com/uPKw1YFa

// Wie viele Lösungen für a² + d² = b² + c² mit 1 <= a < b < c < d <= NMAX gibt es?

#include <stdio.h>
#include <stdint.h>
#include <math.h>

#define NMAX		1000000ULL
#define MEMSIZE		200000ULL

uint64_t Tab_I[MEMSIZE];	// Indeces
uint64_t Tab_V[MEMSIZE];	// Values

// In den Tests zeigte sich, dass sqrt(x) durch den Umweg über das Double-Zahlenformat nicht
// für alle Werte n²..(n+1)²-1 wieder n ergibt. Ab n = 2^26 scheitert der Test n == sqrt((n+1)²-1).
// Abhilfe schafft hier sqrtl(x) mit n bis zu 2^32-1.

void count(void)
{
	uint64_t cnt = 0;

	for (uint64_t slice = 0; slice < 2 * NMAX * NMAX; slice += MEMSIZE) {
		uint64_t i_min = 1;

		if (slice > NMAX * NMAX) i_min = 1 + sqrt(slice - NMAX * NMAX - 1);
			
		for (uint64_t i = i_min; i < NMAX; i++) {
			uint64_t j_min = i + 1;

			if (i * i + j_min * j_min >= slice + MEMSIZE) break;

			if (slice > 2 * i * i) j_min = 1 + sqrt(slice - i * i - 1);
			
			for (uint64_t j = j_min; j <= NMAX; j++) {
				uint64_t i2j2 = i * i + j * j;
				
				if (i2j2 >= slice + MEMSIZE) break;

				uint64_t hash = i2j2 - slice;

				if (Tab_I[hash] == i2j2)
					cnt += Tab_V[hash]++;
				else { 
					Tab_I[hash] = i2j2;
					Tab_V[hash] = 1;
				}
			}
		}
	}

	printf("%llu Lösungen.\n", (unsigned long long)cnt);	// uint64_t ist unsigned long (Linux 64bit) aber unsigned long long (Windows 64bit)
}

int main()
{
	count();
}

/**
 * Schedule an email for one week after a user registers
 * 
 * @param int $user_id User ID of new user
 * @return void
 */
function schedule_email_after_registration( $user_id ) {
    // Get the user's registration date/time
    $user = get_user_by( 'id', $user_id );
    $registered_date = strtotime( $user->user_registered );

    // Schedule to send the email 1 week after registration
    $when_to_send = $registered_date + WEEK_IN_SECONDS;
    
    // Schedule the action with the user ID as an argument
    as_schedule_single_action( $when_to_send, 'send_email_after_week', array( 'user_id' => $user_id ) );
}
add_action( 'user_register', 'schedule_email_after_registration', 10, 1 );

/**
 * Send one week email to user
 * 
 * @param int $user_id User ID to send email
 * @return void
 */
function send_email_after_week_handler( $user_id ) {
    // Get user data
    $user = get_user_by( 'id', $user_id );

    // Bail if the user doesn't exist
	if ( $user === false ) return;

    $to = $user->user_email;
    $subject = 'One week anniversary!';
    $message = 'It has been a week since you registered!';

    // Use WordPress function to send email
    wp_mail( $to, $subject, $message );
}
add_action( 'send_email_after_week', 'send_email_after_week_handler', 10, 1 );

