    // Método: Cálculo da idade (botão)
    private void btnCalActionPerformed(java.awt.event.ActionEvent evt) {                                       

        try
        {
            // Capturando dados
            int ano_atual = cal.get(Calendar.YEAR);              // Ano Atual
            int ano_nasc = Integer.parseInt(txtAnoNas.getText());// Ano Nascimento

            // Cálculos
            int ida = ano_atual - ano_nasc;
            int sem = ida * 48 ;
            int hor = ida * 365 * 24;
            int seg = hor * 60;

            // Saída de dados
            txtAnoAtu.setText(Integer.toString(ano_atual));
            txtIda.setText(Integer.toString(ida));
            txtSem.setText(Integer.toString(sem));
            txtHor.setText(Integer.toString(hor));
            txtSeg.setText(Integer.toString(seg));

            // Estrutura de decisão
            if( ida > 0 && ida < 16  )
            {
                txtSitEle.setText("Votação proibida");
            }

            else if( (ida >= 16 && ida < 18) || (ida >= 70) )
            {
                txtSitEle.setText("Votação opcional");
            }

            else
            {
                txtSitEle.setText("Votação obrigatória");
            }
        }

        catch (NumberFormatException e)
        {
            JOptionPane.showMessageDialog(this, "Preencha o campo corretamente");
            System.err.println(e);
        }
    }                                      

